import React, { Component } from "react";
import Project from "./components/projects";
import "./App.css";
import Paper from "@material-ui/core/Paper/Paper";

const App = props => {
  console.log(props);
  return (
    <div className="App">
      <Paper elevation={5}>
        <Project />
      </Paper>
    </div>
  );
};

export default App;
